import styles from '../../styles/Sidebar.module.css';

const Sidebar = () => {
  return (
    <div className={styles.sidebar}>
      <div className={styles.title}>CATEGORIES</div>
      <nav>
        <ul className={styles.menu}></ul>
      </nav>
    </div>
  );
};

export default Sidebar;
